ODA({ is: 'oda-russia-map',
    template: `
        <style>
            .rf-map, .rf-map * {
                box-sizing: border-box;
            }
            .rf-map {
                position: relative;
                max-width: 980px;
                margin: auto;
                padding: 20px;
            }
            .rf-map .district b {
                position: absolute;
                z-index: 5;
                width: 18px;
                height: 18px;
                background: rgba(51, 122, 183, 0.9);
                border-radius: 50%;
                left: 6px;
                top: 18px;
                transition: all 0.3s;
            }
            .rf-map .district span {
                position: absolute;
                z-index: 5;
                top: 20px;
                left: 30px;
                font-size: 13px;
                font-weight: bold;
                font-family: Tahoma, sans-serif;
                line-height: 1;
                color: #337AB7;
            }
            .rf-map svg {
                width: 100%;
                height: 100%;
                filter: drop-shadow(0 5px 12px rgba(0, 0, 0, 0.5));
            }
            .rf-map path {
                stroke: #FFFFFF;
                stroke-width: 1;
                stroke-linejoin: round;
            }
            .rf-map [data-code] {
                fill: #337AB7;
                transition: fill 0.2s;
            }
            .rf-map [data-code]:hover {
                fill: #0180ef;
            }
            @media (min-width:768px) {
                .rf-map .district b {
                    width: 28px;
                    height: 28px;
                    left: 6px;
                    top: 28px;
                }
                .rf-map .district span {
                    top: 30px;
                    left: 46px;
                    font-size: 20px;
                    font-weight: normal;
                }
            }
            /* Region colors */
            .rf-map [data-code="RU-RYA"] {
                fill: tomato;
                cursor: pointer;
            }
            .rf-map [data-code="RU-RYA"]:hover {
                fill: red;
            }
        </style>
        <div class="rf-map">
            <div ~if="hoverArea  || hover" class="district" @tap="showArea=false; hover=''" style="cursor: pointer"><b></b><span>{{hoverArea  || hover}}</span></div>
            <svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" x="0px" y="0px" viewbox="0 0 808.9 520" xml:space="preserve">
                <g ~if="!area" ~for="regions" ~html="$for.item" @pointerenter="pointerenter($for.item)" @pointerleave="pointerleave" @tap="selectArea"></g>
                <g if="area" style="fill: #337AB7;">
                    <path ~for="area" :d='$for.item.path' @pointerenter="pointerenterArea ($for.item)" @pointerleave="pointerleaveArea "/>
                </g>
            </svg>
        </div>
    `,
    get regions() { return regions },
    get area() { return this.showArea && area[this.selectedArea] },
    showArea: false,
    selectedArea: '',
    hover: '',
    hoverArea : '',
    pointerenter(e) {
        this.selectedArea = e.split('data-code="')[1].split('"')[0];
        this.hover = e.split('data-title="')[1].split('"')[0];
    },
    pointerleave(e) {
        this.hover = '';
    },
    pointerenterArea(e) {
        this.hoverArea = this.hover + ' - ' + e.name;
    },
    pointerleaveArea(e) {
        this.hoverArea = '';
    },
    selectArea(e) {
        this.showArea = area[this.selectedArea] ? true : false;
    }
})

